import React from 'react';

import './homePage.css';

import Header from '../../components/header/header';
import Navbar from '../../components/navbar/navbar';
import SquareLink from '../../components/squareLink/squareLink';
import Footer from '../../components/footer/footer';

const HomePage = () => {

    return (
        <>
        <Header />
        <Navbar />
        <main>
            <SquareLink to={"/videogames/ ?historicalLow=false"} color={"#A79AF5"} text="all games"/>
            <SquareLink to={"/videogames/ ?historicalLow=false&minDiscount=0&maxDiscount=100"} color={"#A4FB95"} text="all discount" />
            <SquareLink to={"/videogames/ ?historicalLow=false&maxPrice=0"} color={"#FF9B63"} text="free games" />
            <SquareLink to={"/videogames/ ?historicalLow=true"} color={"#FFE0E0"} text="historical low" />
            <SquareLink to={"/videogame/ ?historicalLow=false&minDiscount=50"} color={"#FF5454"} text="huge discount" />
            <SquareLink to={"/"} color={"#C6FFFC"} text="last releases" />
            <SquareLink to={"/"} color={"#FDFF9B"} text="windows" />
            <SquareLink to={"/"} color={"#FD92FF"} text="mac" />
        </main>
        <Footer />
        </>
    )
}

export default HomePage;
